import React from "react";

import Header from "../Components/Header";
import Footer from "../Components/Footer";

import classes from "./Compose.module.css";

const JejuDrink = () => {
  return (
    <div
      style={{
        width: "100%",
        maxWidth: "1920px",
        margin: "0 auto",
        position: "relative",
      }}
    >
      <Header bgColor=" " titleColor="#ffffff" />

      <div
        className={classes2.subPageBanner}
        style={{
          background: "url(images/sub_coupangeats_banner.png)",
          width: "100%",
          height: "980px",
          margin: "0 auto",
        }}
      >
        <SubPortfolioInfo portfolioInfo="#222" />

        <SiteButton
          className={classes.composeBtn}
          btnColor="#47b3e2"
          textColor="#ffffff"
          width="150px"
          top="760px"
          left="370px"
          link="coupangeats/index.html"
        />
      </div>

      <Footer footerTop="2367px" />
    </div>
  );
};

export default JejuDrink;
